import React, {useEffect, useRef} from 'react';
import {Carousel} from "react-bootstrap";
import {Link} from "react-router-dom";
import * as THREE from "three"
import {GLTFLoader, GLTF} from "three/examples/jsm/loaders/GLTFLoader"
// @ts-ignore
// import fileGlb from 'knife.glb' // GLB FILE

const Welcome = () => {

    useEffect(() => {
        const scene = new THREE.Scene();
        const camera = new THREE.PerspectiveCamera( 75, Number(document.getElementById("place")?.clientWidth) / 500, 0.1, 1000 );
        const renderer = new THREE.WebGLRenderer();
        renderer.setSize( Number(document.getElementById("place")?.clientWidth), 500 );

        const loader = new GLTFLoader();
        let obj: THREE.Group
        loader.load(
            // resource URL
            'just_a_girl.glb',
            // called when the resource is loaded
            function ( gltf ) {
                obj = gltf.scene
                scene.add( gltf.scene );

            },
            // called while loading is progressing
            function ( xhr ) {

                console.log( ( xhr.loaded / xhr.total * 100 ) + '% loaded' );

            },
            // called when loading has errors
            function ( error ) {

                console.log( 'An error happened' );
                console.log( error);

            }
        );
        scene.background = new THREE.Color(0xffffff)
        let light = new THREE.HemisphereLight(0xffffff, 0x000000, 2)
        scene.add(light)
        camera.position.set(0, 50, 130)
        function animate() {
            requestAnimationFrame( animate );
            renderer.render( scene, camera );
            obj.rotation.set(0.2,0,0);
        }
        let i: any = setInterval(() => {
            animate();

            return clearInterval(i)
        }, 1000)
        document.getElementById("place")?.appendChild( renderer.domElement );
    }, [ ])
    return (
        <>
            <div className="container-fluid px-0">
                <Carousel>
                    <Carousel.Item id={"place"}>
                    </Carousel.Item>
                    {/*<Carousel.Item>*/}
                    {/*    <img*/}
                    {/*        className="d-block w-100"*/}
                    {/*        src="https://www.staff-clothes.com/_next/image/?url=https%3A%2F%2Fstatic.staff-clothes.com%2Fuploads%2Fmedia%2Fdefault%2F0002%2F70%2F61c8caa3d6044fb2b1ebac8e0d95333a.jpeg&w=1920&q=75"*/}
                    {/*        alt="First slide"*/}
                    {/*    />*/}
                    {/*</Carousel.Item>*/}
                    {/*<Carousel.Item>*/}
                    {/*    <img*/}
                    {/*        className="d-block w-100"*/}
                    {/*        src="https://www.staff-clothes.com/_next/image/?url=https%3A%2F%2Fstatic.staff-clothes.com%2Fuploads%2Fmedia%2Fdefault%2F0002%2F72%2F42d486c092fb4fa9aaa1b6697c8b172a.jpeg&w=1920&q=75"*/}
                    {/*        alt="Second slide"*/}
                    {/*    />*/}
                    {/*</Carousel.Item>*/}
                </Carousel>
                <Link to={"wear-basic"}
                    className="btn btn-primary py-2 position-absolute start-50 translate-middle carousel-enter">Go
                    over
                </Link>
            </div>
            <div className="container mt-5">
                <div className="row">
